import React, { useState } from 'react';
import './App.css';
import Post from './Post';

function App() {
  const [posts, setPosts] = useState([
    {
      username: "Tristenaguilar_",
      caption: "First Post!",
      imageUrl: "https://reactjs.org/logo-og.png" 
    },
    {
      username: "Tristenaguilar_",
      caption: "First Post!",
      imageUrl: "https://reactjs.org/logo-og.png" 
    },
  ]);


  return (
    <div className="app">

      <div className = "app_header">
        <img
          className = "app_headerImage"
          src = "https://www.instagram.com/static/images/web/mobile_nav_type_logo.png/735145cfe0a4.png"
          alt = "Instagram Header Logo"
        />
      </div>

      {
        posts.map(post => (
          <Post username = {post.username} caption = {post.caption} imageUrl = {post.imageUrl}></Post>
        ))
      }

      <Post username = "Tristenaguilar_" caption = "First Post!" imageUrl = "https://reactjs.org/logo-og.png" />
      <Post username = "GabyMelo123" caption = "Backend!" imageUrl = "https://firebase.google.com/images/social.png" />
      <Post username = "SunriseX" caption = "Lovin' it!" imageUrl = "https://images.unsplash.com/photo-1494548162494-384bba4ab999?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&w=1000&q=80"/>

    </div>
  );
}

export default App;
